import React from 'react';
import '../styles/Footer.css';

const Footer = () => {
  return (
    <footer className="footer bg-dark text-white py-4">
      <div className="container">
        <div className="row">
          <div className="col-md-6">
            <h5>Empire Partner Foundation</h5>
            <p>Driving innovation and technology to solve Africa's problems.</p>
          </div>
          <div className="col-md-6 text-md-end">
            <ul className="list-unstyled">
              <li><a href="/" className="text-white">Home</a></li>
              <li><a href="/services" className="text-white">Services</a></li>
              <li><a href="/about" className="text-white">About</a></li>
              <li><a href="/contact" className="text-white">Contact</a></li>
              <li><a href="/donate" className="text-white">Donate</a></li>
            </ul>
          </div>
        </div>
        <div className="text-center mt-3">
          <small>&copy; {new Date().getFullYear()} Empire Partner Foundation. All rights reserved.</small>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
